import React from 'react';
import Container from '../components/layaouts/Container'

function App() {
  return (
    <div className="App">
      <Container>
        <h1 text="center ">Bienvenido a la pagina de los gatos!</h1>
      </Container>
    </div>
  );
}

export default App;
